import { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";
import "../styles.css"; // Asegúrate de que tu styles.css esté en src/

export default function Dashboard() {
  const [residente, setResidente] = useState({
    rut: "",
    nombre: "Pendiente de BD",
    proximoControl: "........",
    medico: "........",
    diagnostico: "........",
    medicamento: "........",
    dosis: "........",
    casoSOS: "........"
  });

  const location = useLocation();

  // Obtener el rut desde la query string
  useEffect(() => {
    const params = new URLSearchParams(location.search);
    const rutQuery = params.get("rut");
    if (rutQuery) setResidente(prev => ({ ...prev, rut: rutQuery }));
  }, [location]);

  return (
    <div className="dashboard-container">
      {/* Banner */}
      <header className="banner">
        <div className="logo-container">
          <img src="/img/logo.png" alt="Logo ELEAM" className="logo" />
          <h1 className="logo-text">Red ELEAM</h1>
        </div>
      </header>

      <h2 className="bienvenida" style={{ marginTop: "20px" }}>
        Portal de Medicamentos ELEAM
      </h2>

      {/* Datos del residente */}
      <div className="dashboard-card">
        <h3>Información del Residente</h3>
        <p><b>Nombre residente:</b> {residente.nombre}</p>
        <p><b>RUN:</b> {residente.rut}</p>
        <p><b>Próximo control:</b> {residente.proximoControl}</p>
        <p><b>Médico tratante:</b> {residente.medico}</p>
      </div>

      {/* Botones de acción */}
      <div className="dashboard-buttons">
        <button>📄 Ver Ficha Clínica</button>
        <button>ℹ️ Información Control Anterior</button>
        <button>💊 Información Medicamentos</button>
        <button>🚪 Salir</button>
      </div>

      {/* Diagnóstico */}
      <div className="dashboard-card">
        <h3>Diagnóstico Residente</h3>
        <div style={{ display: "flex", flexWrap: "wrap", gap: "20px" }}>
          <div style={{ flex: 1, minWidth: "250px" }}>
            <p><b>Diagnóstico:</b> {residente.diagnostico}</p>
            <p><b>Médico que indica:</b> {residente.medico}</p>
          </div>
          <div style={{ flex: 1, minWidth: "250px" }}>
            <p><b>Nombre Medicamento (Compuesto):</b> {residente.medicamento}</p>
            <p><b>Dosis:</b> {residente.dosis}</p>
            <p><b>Caso SOS:</b> {residente.casoSOS}</p>
          </div>
        </div>
      </div>
    </div>
  );
}
